import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { logOut } from '../actions';
import { Link } from 'react-router-dom';
import './navbar.css';

const Navbar = () => {
  //redux  
  const auth = useSelector(state => state.auth.auth);
  const dispatch = useDispatch();
  console.log(auth)
  //logs user out
  function handleClick () {
    dispatch(logOut())
  }

  //styling for redux-router links
  //note that it ISN'T css
  const style = {
    textDecoration: 'none',
    color: 'white',
    marginLeft: '20px'
    };

  return(
    <div className="navbar">
      <h3>Schlepper</h3>
      {auth && 

      <div className="links">
      <Link to='/' style={style}>Dashboard |</Link>
      <Link to='/messages' style={style}>Messages |</Link>
      <Link to='/userTrades'style={style}>Active Trades |</Link>
      <Link to='/trades'style={style}>Browse Trades |</Link>
      <Link to='/search'style={style}>Search |</Link>
      <Link to='/profile' style={style}>Profle |</Link>
      <Link to='/' style={style}  onClick={handleClick}>
        {/* <button onClick={handleClick}>Log Out</button> 
            make the link a button to make it more noticable 
        */}
        Log Out
      </Link>
      </div>
      }
    </div>
    );
  };

export default Navbar;
